import React from "react";
import GenerateQRCodeForm from "components/Home/GenerateQRCodeForm";

const CreateQRCode = () => {
  return (
    <View style={styles.container}>
      <View style={styles.leftCol}>
        <GenerateQRCodeForm />
      </View>
      <View style={styles.rightCol}>
        <Card>
          <Card.Content></Card.Content>
        </Card>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    display: "flex",
    flexDirection: "row",
    flexWrap: "wrap",
    alignItems: "flex-start",
    flex: 1,
  },
  leftCol: {
    marginTop: "100px",
    width: "50%",
  },
  rightCol: {
    marginTop: "100px",
    width: "50%",
  },
});

export default CreateQRCode;
